import{_ as i,c as e,a1 as a,o as t}from"./chunks/framework.clinZALv.js";const c=JSON.parse('{"title":"状态码","description":"","frontmatter":{},"headers":[],"relativePath":"pages/文章/计算机网络/状态码/index.md","filePath":"pages/文章/计算机网络/状态码/index.md"}'),p={name:"pages/文章/计算机网络/状态码/index.md"};function x(o,l,r,s,n,d){return t(),e("div",null,l[0]||(l[0]=[a('<h1 id="状态码" tabindex="-1">状态码 <a class="header-anchor" href="#状态码" aria-label="Permalink to &quot;状态码&quot;">​</a></h1><p>HTTP状态码（英语：HTTP Status Code）是用以表示Web服务器或者其他网络服务器上请求的响应状态的三位数字代码。</p><p>HTTP状态码共分为5种类型：</p><ol><li>信息响应（1xx）</li><li>成功响应（2xx）</li><li>重定向（3xx）</li><li>客户端错误（4xx）</li><li>服务器错误（5xx）</li></ol><p>1xx 信息响应</p><ul><li>100（继续）</li><li>101（切换协议）</li><li>102（Processing）</li></ul><p>2xx 成功响应</p><ul><li>200（成功）</li><li>201（已创建）</li><li>202（已接受）</li><li>203（非授权信息）</li><li>204（无内容）</li><li>205（重置内容）</li><li>206（部分内容）</li></ul><p>3xx 重定向</p><ul><li>300（多种选择）</li><li>301（永久移动）</li><li>302（临时移动）</li><li>303（查看其他位置）</li><li>304（未修改）</li><li>307（临时重定向）</li></ul><p>4xx 客户端错误</p><ul><li>400（错误请求）</li><li>401（未授权）</li><li>402（需要付款）</li><li>403（禁止）</li><li>404（未找到）</li><li>405（方法不允许）</li><li>406（不接受）</li><li>408（请求超时）</li><li>409（冲突）</li><li>410（已删除）</li><li>411（需要内容长度）</li></ul><p>5xx 服务器错误</p><ul><li>500（服务器内部错误）</li><li>501（尚未实施）</li><li>502（错误网关）</li><li>503（服务不可用）</li><li>504（网关超时）</li><li>505（HTTP版本不受支持）</li></ul>',14)]))}const m=i(p,[["render",x]]);export{c as __pageData,m as default};
